import React, { Component } from "react";
import Nav from "../Nav";
import portfolio from "./assets/portfolio";

class Portfolio extends Component {
    render() {
        const divStyle = {
            color: "black",
            border: "2px white solid",
            borderRadius: "10px",
            background: "#ffffff80",
            fontFamily: "Arial, Helvetica, sans-serif",
            width: "50%",
            margin: "0 auto",
            display: "block",
            padding: "10px"
        }

        const titleStyle = {
            fontSize: "1.2rem",
            borderBottom: "1px black solid",
            width: "70%",
            marginBottom: "10px"
        }

        return (
            <div>
                <Nav />
                <div style={divStyle}>
                    <div style={titleStyle}>
                        Work
                    </div>
                    <div>
                        {portfolio.map((site) => (
                            <Grid title={site.title} url={site.url} image={site.image} />
                        ))}
                    </div>
                </div>
            </div>
        )
    }
}

const gridStyle = {
    color: "blue",

}

class Grid extends Component {
    render(props) {
        return (
            <div style={gridStyle}>
        <h1>{props.title}</h1>
        </div >
        )
    }
}


export default Portfolio;
